import "./App.css";
import Weather from "./Weather";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Weather city="London" />
        <a
          href="https://github.com/Nwakomi/final-weather-app"
          rel="noreferrer"
          target="_blank"
        >
          Github repository
        </a>
      </header>
    </div>
  );
}

export default App;
